				this.C3Memory.CurrentProcess = process;
	
				////////////////////////////////////////////
				//// STORE PROCESS MEMORY [TOTAL PERCENTAGE]
				this.C3Memory.ProcessDictionary[process].TotalPercentage = totalPercentage;
	
